export const initialState = [
  { item: "Learn about reducers", completed: false, id: Date.now() },
  { item: "reducers", completed: false, id: Date.now() }
];

export const todoReducer = (state, action) => {
  switch (action.type) {
    case "ADD_TODO":
      return [action.newTodo, ...state];

    default:
      return state;
  }
};
